Gismart Piano is a virtual musical instrument app with an electric keyboard simulator, where you can play any song and chord. Discover many interesting ways to play the piano keys! 

The realistic piano with free songs made by musicians for musicians and beginners! Download right now and play the piano keyboard on your Phone or Tablet for free!

Our digital Piano app lets you choose sounds from a number of music instruments: from a piano keyboard and grand piano, to the violin, harpsichord, accordion, organ and guitar. Carve out original melodies and record them to play back via different musical instruments. You’ll learn various chords and how to read sheet music, taking you on your journey to become a virtual piano player and maestro!

***Here’s more***
Enjoy our cool mini games and start playing the piano without any lessons. Perform famous songs by tapping keys under falling tiles in the Magic Tiles game. Improve your sense of timing and tempo by tapping random white and black keys in the Magic Keys.

***Piano app features***
- Full 88 key piano keyboard;
- Magic Tiles and Magic Keys mini games;
- 9 different piano keyboards and musical instruments: Piano Keyboard, Grand Piano, Organ, Harpsichord, Accordion, Electric Guitar, Harp, Cello Pizzicato, Vintage Piano;
- Single or Dual scrollable keyboard;
- Free piano songs;
- Popular and classic piano songs;
- Piano record feature - record and share your plays;
- Piano HD.

